7c677e5bc89fc717c5ef39c431a967dc:
query ProfileQuery(
  $username: String!
) {
  user(username: $username) {
    id
    name
    username
    bio
    type
    postsCount
    subscribersCount
    isViewer
    avatarUrl
    isCurrentlySubscribed
    isFollowing
    ...FollowButton_user
    ...Posts_user
  }
}

fragment FollowButton_user on User {
  id
  isFollowing
}

fragment Post_post on Post {
  id
  text
  visibility
  favoritesCount
  hasFavorited
  createdAt
  user {
    id
    name
    username
    avatarUrl
  }
  media {
    url
    type
    id
  }
}

fragment Posts_user on User {
  pinnedPost {
    ...Post_post
    id
  }
  posts {
    ...Post_post
    id
  }
}

